{% load custom_tags %}
{% load static %}


<!doctype html>
<html>
  <head>
    <meta charset="utf-8">
    <title>{{ title }}</title>
    <meta name="description" content="{{ title }}">
    <meta name="author" content="HTC-MIS">

    <style type="text/css" media="print">
        @charset "UTF-8";
        @import url('https://fonts.googleapis.com/css?family=Times+New+Roman');
        @page {
            size: A4;
            margin: 1.5cm;
            @bottom-right {
                color: #a9a;
                content: '{{ domain_name }}';
                font-family: 'Roboto', sans-serif;
                font-size: 10pt;
            }
        }

        html {
            color: #14213d;
            font-family: 'Roboto', sans-serif;
            font-size: 10pt;
            line-height: 1.6;
        }

        html body {
            margin: 0;
        }

        html section#title {
            align-items: center;
            justify-content: center;
            display: flex;
            text-align: center;
            margin-bottom: 6em;
        }

        html section#title h1 {
            font-size: 20pt;
            margin-top: 6em;
        }

        html section#filtering {
            align-items: center;
            justify-content: left;
            display: flex;
            margin-bottom: 2em;
        }

        html img.logo_left {
            width: 320px;
            height: 50px;
            float: left;
        }

        html img.logo_right {
            width: 175px;
            height: 90px;
            float: right;
        }

        html aside {
            display: flex;
            margin: 2em 0 4em;
        }

        html aside address {
            font-style: normal;
            white-space: pre-line;
        }

        html aside address#from {
            color: #a9a;
            flex: 1;
        }

        html aside address#to {
            text-align: right;
        }

        html dl {
            text-align: right;
            position: absolute;
            right: 0;
            top: 0;
        }

        html dl dt, html dl dd {
            display: inline;
            margin: 0;
        }

        html dl dt {
            color: #a9a;
        }

        html dl dt::before {
            content: '';
            display: block;
        }

        html dl dt::after {
            content: ':';
        }

        html table {
            border-collapse: collapse;
            width: 100%;
            overflow-wrap: break-word;
            table-layout: fixed;
        }

        html table th {
            border-bottom: .2mm solid #a9a;
            color: #a9a;
            font-size: 9pt;
            font-weight: 400;
            padding-bottom: .25cm;
            text-transform: uppercase;
        }

        html table td {
            padding-top: 4mm;
        }

        html table td:last-of-type {

        }

        html table th, html table td {
            text-align: center;
        }

        html table th:first-of-type, html table td:first-of-type {
            text-align: left;
        }

        html table th:last-of-type, html table td:last-of-type {
            text-align: right;
        }

        html table#total {
            background: #f6f6f6;
            border-color: #f6f6f6;
            border-style: solid;
            border-width: 2cm 3cm;
            bottom: 0;
            font-size: 20pt;
            margin: 0 -3cm;
            position: absolute;
            width: 18cm;
        }
    </style>
  </head>
